import React from 'react';
import styled from "styled-components";

const Top = styled.nav`
    display: flex;
    background-color:black;


`;

const Title = styled.h1`
  margin-left :60px;
  color:white;
`;


const Navigation = () => {
    return (
        <Top>
            <Title>Album</Title>
        </Top>
    );
};

export default Navigation;
